<style>
    /* Style the slider */
    #opacity-slider {
        width: 100%;
        appearance: none;
        background: #1B3F8B; 
        height: 7px;  
        border-radius: 5px;
    }

    /* Style the slider thumb */
    #opacity-slider::-webkit-slider-runnable-track {
        height: 7px;
        border-radius: 5px;
    }

    #opacity-slider::-webkit-slider-thumb {
        width: 12px;  /* thumb width */
        height: 12px;  /* thumb height */
        background: white;  /* white thumb */
        border: 1px solid darkblue;
        border-radius: 50%;  /* round thumb */
        cursor: pointer;
        -webkit-appearance: none;
        margin-top: -2px;  /* adjust the thumb to center it */
    }

    #opacity-slider::-moz-range-thumb {
        width: 12px;  /* thumb width */
        height: 12px;  /* thumb height */
        background: white;  /* white thumb */
        border: 2px solid darkblue;
        border-radius: 50%;  /* round thumb */
        cursor: pointer;
    }

    #opacity-slider::-ms-thumb {
        width: 12px;  /* thumb width */
        height: 12px;  /* thumb height */
        background: white;  /* white thumb */
        border: 2px solid darkblue;
        border-radius: 50%;  /* round thumb */
        cursor: pointer;
    }
</style>

<script>
    var geojsonLayer = document.getElementsByClassName("leaflet-interactive");
    var slider = document.getElementById("opacity-slider");
    
    // Funktion zum Setzen des Hintergrunds des Sliders
    function updateSliderBackground() {
        var value = slider.value;
        var percentage = (value - slider.min) / (slider.max - slider.min) * 100;
        slider.style.background = `linear-gradient(to right, #1B3F8B ${percentage}%, white ${percentage}%)`;
    }

    // Initialer Hintergrund-Update
    updateSliderBackground();

    slider.oninput = function() {
        // Update Opazit√§t
        Array.from(geojsonLayer).forEach(function(layer) {
            layer.style.fillOpacity = parseFloat(slider.value);
        });
        // Update des Slider-Hintergrunds
        updateSliderBackground();
    }
</script>
